import React from "react";
import Buscador from "./components/Buscador/Buscador";
import { Route } from "react-router-dom";


function App() {
  return (
      <React.Fragment>
          <NavBar />
          <Route exact path="/" component={Buscador} />
      </React.Fragment>
  );
}

export default App;
